import React from "react";
import "./styles.scss";
import { NavLink } from "react-router-dom";



const Header = () => {

    return (
       <header className="headerHed">
        <div className="wrapperheader">Title</div>
        <div className="mainPageHeder">Главная</div>
        <div className="filmsHeder">Фильмы по категориям</div>
        <div className="aboutHeder">О нас</div>
        <div className="searchHeder">Поиск</div>

       </header>
       
    )
}
export default Header;
